#include <stdio.h>
#include <errno.h>

int main() {
    int NUMBER_OF_GRADES;
    int GRADE_X;
    int Sum = 0;

    printf("Inserire numero di voti per la media aritmetica: ");
    if (scanf("%d", &NUMBER_OF_GRADES) != 1) {
        perror("Errore trovato nell'inserimento di dei voti ricevuti..");
        return 1;
    } else if (NUMBER_OF_GRADES <= 0) {
        perror("Errore trovato nell'inserimento di dei voti Ã¨ errato, il valore inserito Ã¨ negativo");
        return 1;
    }

    for (int i=1; i<=NUMBER_OF_GRADES; i++) {
        printf("inserire voto n%d: ", i);
        if (scanf("%d", &GRADE_X)!=1) {
            perror("Errore trovato nell'inserimento del voto..");
            return 1;
        } else if (GRADE_X <= 0) {
            perror("Errore trovato nell'inserimento del voto.. non esistono voti negativi");
            return 1;
        }
        Sum = Sum + GRADE_X;
    }

    GRADE_X = Sum/NUMBER_OF_GRADES;
    printf("La media finale Ã¨ di %d", GRADE_X);

    return 0;
}
